import { View, ScrollView, Text } from 'react-native';
import { ScrollViewPerfumes } from '../ScrollViews/ScrollViewPerfumes';
import { ScrollViewHidratantes } from '../ScrollViews/ScrollViewHidratantes';
import { ScrollViewKits } from '../ScrollViews/ScrollViewKits';
import { useFonts } from 'expo-font';
import { NavBar } from '../NavBar/NavBar'
import { TextInput } from 'react-native-paper';
import { useState } from 'react';

export function MainPage({ navigation }) {
    const [fontsLoaded] = useFonts({
        'Raleway-Black': require('../../../assets/fonts/Raleway-Black.ttf'),
        'Raleway-Bold': require('../../../assets/fonts/Raleway-Bold.ttf'),
        'Raleway-Medium': require('../../../assets/fonts/Raleway-Medium.ttf'),
    });

    const [isTextInputFocused, setTextInputFocused] = useState(false);
    const [pesquisa, setPesquisa] = useState('');

    const handleFocus = () => {
        setTextInputFocused(true);
    };

    const handleBlur = () => {
        setTextInputFocused(false);
    };

    return (
        <View style={{ backgroundColor: '#F9F9F9', flex: 1 }}>
                <View style={{ position: 'fixed', zIndex: 1, width: '100%', height: 150, backgroundColor: '#FFFFFF' }}>
                    <Text style={{ fontSize: 34, fontFamily: 'Raleway-Bold', top: 62, left: 20 }}>PÃ¡gina Inicial</Text>
                    <TextInput label={'Pesquisar:'} onChangeText={setPesquisa} onBlur={handleBlur} />
                </View>
            {isTextInputFocused ? (
                <View style={{ flexDirection: 'row', flexWrap: 'wrap', left: 20, paddingBottom: 83 }}>
                {AllProdutos.map((item, index) => (
                    <View key={index} style={{ margin: 10, marginRight: 17 }}>
                        <Image source={{ uri: item.imageUrl }} style={{ width: 148, height: 184, borderRadius: 8, shadowColor: "rgba(211, 38, 38, 0.25)", shadowOffset: { width: 0, height: 4 }, shadowRadius: 8, elevation: 8, shadowOpacity: 1, }} />
                        <View style={{display: 'flex', flexDirection: 'row', alignItems: 'center', justifyContent: 'space-between'}}>
                            <View>
                                <Text style={{ fontSize: 11, color: "#9B9B9B", fontFamily: "Raleway-Regular", marginTop: 26 }}>{Capitalize(item.pasta)}</Text>
                                <Text style={{ fontSize: 20, color: "#222222", fontFamily: "Raleway-Italic", marginTop: 4 }}>{item.nome}</Text>
                                <Text style={{ fontSize: 18, color: "#DB3022", fontFamily: "Raleway-Medium", marginTop: 4 }}>R$ {item.preco}</Text>
                            </View>
                            <View style={{display: 'flex', flexDirection: 'column', justifyContent: 'space-between', height: '100%', paddingTop: 26}}>
                                <TouchableOpacity style={{ height: 30, width: 30, backgroundColor: '#6495ED', borderRadius: 8, padding: 8, alignItems: 'center', justifyContent: 'center'}} onPress={() => navigation.navigate('AddProduto', item)}>
                                    <Icon
                                        name={'edit'}
                                        size={18}
                                        color="#FFF"
                                    />
                                </TouchableOpacity>
                                <TouchableOpacity style={{ height: 30, width: 30, backgroundColor: '#FA8072', borderRadius: 8, padding: 8, alignItems: 'center', justifyContent: 'center'}} onPress={() => deletarProduto(item.id, Capitalize(item.pasta), item.nome)}>
                                    <Icon
                                        name={'delete'}
                                        size={18}
                                        color="#FFF"
                                    />
                                </TouchableOpacity>
                            </View>
                        </View>
                    </View>
                ))}
            </View>
            ) : (
                <ScrollView style={{ marginTop: 150, flex: 1, height: 662, paddingBottom: 83, paddingTop: 15 }}>
                    <Text style={{ fontSize: 34, fontFamily: 'Raleway-Bold', left: 20, marginBottom: 10, fontWeight: 'bold' }}>
                        Perfumes
                    </Text>
                    <ScrollViewPerfumes></ScrollViewPerfumes>
                    <Text style={{ fontSize: 34, fontFamily: 'Raleway-Bold', left: 20, marginBottom: 10, marginTop: 10, fontWeight: 'bold' }}>
                        Hidratantes
                    </Text>
                    <ScrollViewHidratantes></ScrollViewHidratantes>
                    <Text style={{ fontSize: 34, fontFamily: 'Raleway-Bold', left: 20, marginBottom: 10, marginTop: 10, fontWeight: 'bold' }}>
                        Kits
                    </Text>
                    <ScrollViewKits></ScrollViewKits>
                </ScrollView>
            )}
            <NavBar></NavBar>
        </View>
    )
}
